import React from 'react';

const ListItem = ({ listItems }) => {
  return (
    <ul>
      {
        listItems.map(listItem => {
          return (
            <li className="list" key=''>
              <img src={listItem.img} alt="Give dog a bath" />
              <p>
                Give dog a bath
              </p>
            </li>
          )
        })
      }

    </ul>
  );
}

export default ListItem;
